import React from 'react'
import {Row, Form} from "antd";
import TextFieldComp from "../Components/TextFieldComp";
import DatePickerComp from "../Components/DatePickerComp";

const layout = {
    labelCol: {
        span: 8,
    },
    wrapperCol: {
        span: 16,
    },
};

class FormDev extends React.Component {
    render() {
        return (
            <div>
                <main>
                    <Form
                        name = "FormDev"
                    >

                        <Row gutter={[16, 24]}>
                                <TextFieldComp
                                    label = "Name of Child: "
                                    placeholder = "Enter name of child"
                                    name = "nameOfChild"
                                />
                                <TextFieldComp
                                    label = "Person Completing the Form "
                                    placeholder = ""
                                    name = "personCompleting"
                                />
                                <DatePickerComp
                                    label = "Date:"
                                />
                        </Row>

                        <Row gutter={[16, 24]}>
                            <DatePickerComp
                                label = "Date of Birth:"
                            />
                            <TextFieldComp
                                label = "Age: "
                                placeHolder = ""
                                name = "age"
                            />
                            

                        </Row>
                 </Form>
                </main>
            </div>
        );
    }
}



export default FormDev;
